import React from 'react';
import {ContextProvider} from "./component/Context"
import { 
  HomeOutlined,
  ShoppingCartOutlined,
  CreditCardOutlined,
  MedicineBoxOutlined,
  ShoppingOutlined,
  PartitionOutlined
} from '@ant-design/icons';
import { Breadcrumb, Layout,  theme } from 'antd';
import { BrowserRouter, Routes, Route,Link} from "react-router-dom";
import Shop from './component/Shop';
import Cart from './component/Cart';
import Checked from './component/checked/Checked';
import Search from './component/Search'
import Letter from './component/letter/Letter';
import Makeups from './component/Makeups';
import Medicine from './component/Medicine';
import Sk2 from './component/Sk2';
import MakeOther from './component/MakeOther';
import Haba from './component/Haba';
import Others from './component/Others';
import AllMakeups from './component/AllMakeup';

const { Header, Content, Footer, Sider } = Layout;
const App = () => {
  const {
    token: { colorBgContainer },
  } = theme.useToken();
  return (
    <ContextProvider>
    <BrowserRouter>
    <Layout>
      <Header className="header">
        <div className="logo" /> 
       <Link to="/"><HomeOutlined style={{fontSize: '30px', color: 'orange' }}/>店铺首页</Link>
       <Link to="/cart"><ShoppingCartOutlined style={{ fontSize: '30px', color: 'orange' }}/>购物车</Link>
       <Link to="/checked"><CreditCardOutlined style={{ fontSize: '30px', color: 'orange' }}/>结账</Link>
      </Header>
      <Content
        style={{
          padding: '0 50px',
        }}
      >
        <Breadcrumb
          style={{
            margin: '10px 0',
          }}
        >
          <Breadcrumb.Item>
          <Letter/>
          </Breadcrumb.Item>
          <Breadcrumb.Separator />
          <Breadcrumb.Item>
          <Search/>
          </Breadcrumb.Item>
        </Breadcrumb>
        <Layout
          style={{
            padding: '5px 0',
            background: colorBgContainer,
          }}
        >
          <Sider
            style={{
              background: colorBgContainer,
              float:'left',
            }}
            width={150}

          >
          <nav>
       <Link to="/makeups"><ShoppingOutlined style={{fontSize: '30px', color: 'orange' }}/> 化妆品</Link>
       <Link to="/medicine"><MedicineBoxOutlined style={{ fontSize: '30px', color: 'orange' }}/>  药物</Link>
       <Link to="/others"><PartitionOutlined style={{ fontSize: '30px', color: 'orange' }}/> 其他</Link>
       </nav>
          </Sider>
          <Content
            style={{
              padding: '0 24px',
              minHeight: 200,
            }}
          >
         <Routes>
          <Route path="/" element={<Shop/>}/>
          <Route path="/cart" element={<Cart/>}/>
          <Route path="/checked" element={<Checked/>}/>
          <Route path="/makeups" element={<Makeups/>}/>
          <Route path="/medicine" element={<Medicine/>}/>
          <Route path="/others" element={<Others/>}/>
          <Route path="/makeups/all" element={<AllMakeups/>}/>
          <Route path="/makeups/sk2" element={<Sk2/>}/>
          <Route path="/makeups/haba" element={<Haba/>}/>
          <Route path="/makeups/others" element={<MakeOther/>}/>
        </Routes>
          </Content>
        </Layout>
      </Content>
      <Footer
        style={{
          textAlign: 'center',
          position: 'absolute',
          bottom: 0,
        }}
      >
        大桔株式会社2023
      </Footer>
    </Layout>
    </BrowserRouter>
    </ContextProvider>
  );
};
export default App;
